@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:Bank rdf:type rdfs:Class .
atm:ATM rdf:type rdfs:Class .
atm:BadAccount rdf:type rdfs:Class .

atm:sends rdf:type rdf:Property ;
    rdfs:domain atm:Bank ;
    rdfs:range atm:BadAccount .

atm:receives rdf:type rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:BadAccount .

atm:BadAccount rdfs:subClassOf [
    rdf:type owl:Restriction ;
    owl:onProperty atm:receives ;
    owl:someValuesFrom atm:Bank
] .
